import first from './1.jpeg';
import second from './2.jpeg';
import third from './3.jpeg';
import fourth from './4.jpeg';
import fifth from './5.jpeg';

function App() {
  return (
    <div className='container'>
      <div className='texts' style={{ backgroundImage: `url(${first})`}}>
        <h1 >Center</h1>
      </div>
      <div className='texts' style={{ backgroundImage: `url(${second})`}}>
        <h1 >Bottom Right</h1>
      </div>
      <div className='texts' style={{ backgroundImage: `url(${third})`}}>
        <h1 >Bottom Left</h1>
      </div>
      <div className='texts' style={{ backgroundImage: `url(${fourth})`}}>
        <h1 >Bottom Left</h1>
      </div>
      <div className='texts' style={{ backgroundImage: `url(${fifth})`}}>
        <h1 >Bottom Left</h1>
      </div>


    </div>
  );
}

export default App;


